INSERT INTO `infra_file_content` VALUES (3,4,'deploy.sh',_binary '#!/bin/bash\nset -e\n\nDATE=$(date +%Y%m%d%H%M)\n# 服务名称。同时约定部署服务的 jar 包名字也为它。\nSERVER_NAME=yudao-module-system-biz\n# 环境\nPROFILES_ACTIVE=prod\n\n# heapError 存放路径\nHEAP_ERROR_PATH=heapError\n# JVM 参数\nJAVA_OPS=\"-Xms128m -Xmx128m -XX:+HeapDumpOnOutOfMemoryError -XX:HeapDumpPath=$HEAP_ERROR_PATH\"\n\n# 停止：优雅关闭之前已经启动的服务\nfunction stop() {\n  echo \"[stop] 开始停止 $SERVER_NAME\"\n  PID=$(ps -ef | grep $SERVER_NAME | grep -v \"grep\" | awk \'{print $2}\')\n  # 如果 Java 服务启动中，则进行关闭\n  if [ -n \"$PID\" ]; then\n    # 正常关闭\n    echo \"[stop] $SERVER_NAME 运行中，开始 kill [$PID]\"\n    kill -15 $PID\n    # 等待最大 120 秒，直到关闭完成。\n    for ((i = 0; i < 120; i++)); do\n      sleep 1\n      PID=$(ps -ef | grep $SERVER_NAME | grep -v \"grep\" | awk \'{print $2}\')\n      if [ -n \"$PID\" ]; then\n        echo -e \".\\c\"\n      else\n        echo \'[stop] 停止 $SERVER_NAME 成功\'\n        break\n      fi\n    done\n\n    # 如果正常关闭失败，那么进行强制 kill -9 进行关闭\n    if [ -n \"$PID\" ]; then\n      echo \"[stop] $SERVER_NAME 失败，强制 kill -9 $PID\"\n      kill -9 $PID\n    fi\n  # 如果 Java 服务未启动，则无需关闭\n  else\n    echo \"[stop] $SERVER_NAME 未启动，无需停止\"\n  fi\n}\n\n# 启动：启动后端项目\nfunction start() {\n  # 开启启动前，打印启动参数\n  echo \"[start] 开始启动 $SERVER_NAME\"\n  echo \"[start] JAVA_OPS: $JAVA_OPS\"\n  echo \"[start] JAVA_AGENT: $JAVA_AGENT\"\n  echo \"[start] PROFILES: $PROFILES_ACTIVE\"\n\n  # 开始启动\n  nohup java -server $JAVA_OPS $JAVA_AGENT -jar $SERVER_NAME.jar --spring.profiles.active=$PROFILES_ACTIVE >nohup.out 2>&1 &\n  echo \"[start] 启动 $SERVER_NAME 完成\"\n}\n\n#系统模块\nfunction startSystem() {\n  cd system\n  SERVER_NAME=yudao-module-system-biz\n  # 第一步：停止 Java 服务\n  stop\n  # 第二步：启动 Java 服务\n  start\n  cd ..\n}\n#基础模块\nfunction startInfra() {\n  cd infra\n  SERVER_NAME=yudao-module-infra-biz\n  # 第一步：停止 Java 服务\n  stop\n  # 第二步：启动 Java 服务\n  start\n  cd ..\n}\n#报表模块\nfunction startReport() {\n  cd report\n  SERVER_NAME=yudao-module-report-biz\n  # 第一步：停止 Java 服务\n  stop\n  # 第二步：启动 Java 服务\n  start\n  cd ..\n}\n#工作流模块\nfunction startBpm() {\n  cd bpm\n  SERVER_NAME=yudao-module-bpm-biz\n  # 第一步：停止 Java 服务\n  stop\n  # 第二步：启动 Java 服务\n  start\n  cd ..\n}\n\n# 部署\nfunction deploy() {\n\n  startSystem\n  startInfra\n  startReport\n  startBpm\n\n  ps -ef | grep yudao\n  echo \"[ok] 所有服务启动完成\"\n}\n\ndeploy\n','1','2023-07-20 10:25:39','1','2023-07-20 11:01:45',_binary '');
